import React, { useState, useEffect } from 'react';
import {
  BarChart, Bar, PieChart, Pie,
  XAxis, YAxis, CartesianGrid, Tooltip, Legend,
  ResponsiveContainer, Cell
} from 'recharts';

// Mock data for immediate display while real data loads
const mockErrorCodeData = [
  { errorCode: "E123", count: 42 },
  { errorCode: "E045", count: 38 },
  { errorCode: "E211", count: 27 },
  { errorCode: "E078", count: 19 },
  { errorCode: "E156", count: 15 },
];

const mockPredictedFailuresData = [
  { name: "MRI_001", value: 12 },
  { name: "MRI_002", value: 8 },
  { name: "MRI_003", value: 5 },
  { name: "MRI_004", value: 3 },
];

const mockMachineRuntimeData = [
  { machineId: "MRI_001", avgRuntime: 452 },
  { machineId: "MRI_002", avgRuntime: 387 },
  { machineId: "MRI_003", avgRuntime: 521 },
  { machineId: "MRI_004", avgRuntime: 312 },
];

// Custom colors for charts
const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042', '#8884d8', '#82ca9d', '#ffc658', '#ff7300'];

export default function MRIVisualizationDashboard() {
  // State for storing data
  const [errorCodeData, setErrorCodeData] = useState(mockErrorCodeData);
  const [predictedFailuresData, setPredictedFailuresData] = useState(mockPredictedFailuresData);
  const [machineRuntimeData, setMachineRuntimeData] = useState(mockMachineRuntimeData);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [dataSource, setDataSource] = useState('mock');

  // Fetch data from backend or use mock data
  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);

        // Try to fetch real data
        try {
          // Fetch error code data from Athena
          const errorCodeResponse = await fetch('/api/search-athena', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ keyword: 'Error' })
          });

          if (errorCodeResponse.ok) {
            const errorCodeResult = await errorCodeResponse.json();
            if (errorCodeResult.data && errorCodeResult.data.slice(1)) {
              const errorCodeCounts = {};
              errorCodeResult.data.slice(1).forEach(row => {
                if (row.Data && row.Data[2] && row.Data[2].VarCharValue) {
                  const errorCode = row.Data[2].VarCharValue;
                  errorCodeCounts[errorCode] = (errorCodeCounts[errorCode] || 0) + 1;
                }
              });
              const processedErrorCodeData = Object.keys(errorCodeCounts)
                .map(code => ({ errorCode: code, count: errorCodeCounts[code] }))
                .sort((a, b) => b.count - a.count)
                .slice(0, 10);
              setErrorCodeData(processedErrorCodeData);
            } else {
              console.warn("No or invalid error code data from API.");
            }
          } else {
            console.error("Failed to fetch error code data:", errorCodeResponse.status);
          }

          // Fetch predicted failures from Azure Blob
          const predictionsResponse = await fetch('/api/latest-predictions');
          if (predictionsResponse.ok) {
            const predictionsResult = await predictionsResponse.json();
            if (predictionsResult.data && Array.isArray(predictionsResult.data)) {
              const machineFailureCounts = {};
              predictionsResult.data.forEach(item => {
                const machineId = item.machine_id;
                if (machineId) {
                  machineFailureCounts[machineId] = (machineFailureCounts[machineId] || 0) + 1;
                }
              });
              const processedPredictionsData = Object.keys(machineFailureCounts)
                .map(machine => ({ name: machine, value: machineFailureCounts[machine] }));
              setPredictedFailuresData(processedPredictionsData);
            } else {
              console.warn("No or invalid predictions data from API.");
            }
          } else {
            console.error("Failed to fetch predictions data:", predictionsResponse.status);
          }

          // Fetch runtime data from S3
          const runtimeResponse = await fetch('/api/latest-s3-log');
          if (runtimeResponse.ok) {
            const runtimeResult = await runtimeResponse.json();
            if (runtimeResult.data && Array.isArray(runtimeResult.data)) {
              const machineRuntimes = {};
              const runtimeCounts = {};
              runtimeResult.data.forEach(item => {
                if (item.machine_id && item.machine_runtime) {
                  const machineId = item.machine_id;
                  const runtime = parseInt(item.machine_runtime, 10);
                  if (!isNaN(runtime)) {
                    machineRuntimes[machineId] = (machineRuntimes[machineId] || 0) + runtime;
                    runtimeCounts[machineId] = (runtimeCounts[machineId] || 0) + 1;
                  }
                }
              });
              const processedRuntimeData = Object.keys(machineRuntimes)
                .map(machine => ({
                  machineId: machine,
                  avgRuntime: runtimeCounts[machine] > 0 ? machineRuntimes[machine] / runtimeCounts[machine] : 0,
                }));
              setMachineRuntimeData(processedRuntimeData);
            } else {
              console.warn("No or invalid runtime data from API.");
            }
          } else {
            console.error("Failed to fetch runtime data:", runtimeResponse.status);
          }

          setDataSource('api');
        } catch (apiError) {
          console.log('API Error, using mock data:', apiError);
          setDataSource('mock');
        }
      } catch (err) {
        console.error('Error in visualization component:', err);
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  // Custom tooltip for pie chart
  const CustomTooltip = ({ active, payload }) => {
    if (active && payload && payload.length) {
      return (
        <div className="bg-white p-2 border border-gray-200 shadow-md rounded-md">
          <p className="font-bold">{`${payload[0].name}: ${payload[0].value}`}</p>
          <p>{`${(payload[0].percent * 100).toFixed(2)}% of predictions`}</p>
        </div>
      );
    }
    return null;
  };

  return (
    <div className="p-6 max-w-6xl mx-auto">
      <h1 className="text-3xl font-bold mb-8 text-center text-gray-800">MRI Machine Analytics Dashboard</h1>

      {error && (
        <div className="bg-red-50 p-4 rounded-lg border border-red-200 text-red-700 mb-6">
          <p className="font-bold">Error loading visualizations:</p>
          <p>{error}</p>
        </div>
      )}

      {dataSource === 'mock' && !loading && (
        <div className="bg-blue-50 p-4 rounded-lg border border-blue-200 text-blue-700 mb-6">
          <p className="font-bold">Note: Using sample data for visualization</p>
          <p>Real API data could not be loaded. Displaying demo charts instead.</p>
        </div>
      )}

      <div className="grid grid-cols-1 md:grid-cols-2 gap-8 mb-8">
        {/* Error Codes Bar Chart */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-4 text-gray-700">Most Frequent Error Codes</h2>
          <div className="h-64">
            <ResponsiveContainer width="100%" height="100%">
              <BarChart data={errorCodeData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="errorCode" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="count" fill="#8884d8" name="Frequency" />
              </BarChart>
            </ResponsiveContainer>
          </div>
        </div>

        {/* Predicted Failures Pie Chart */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-4 text-gray-700">Predicted Failures by Machine</h2>
          <div className="h-64">
            <ResponsiveContainer width="100%" height="100%">
              <PieChart>
                <Pie
                  data={predictedFailuresData}
                  cx="50%"
                  cy="50%"
                  labelLine={false}
                  outerRadius={80}
                  fill="#8884d8"
                  dataKey="value"
                  nameKey="name"
                  label={({ name, percent }) => `${name}: ${(percent * 100).toFixed(0)}%`}
                >
                  {predictedFailuresData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                  ))}
                </Pie>
                <Tooltip content={<CustomTooltip />} />
                <Legend />
              </PieChart>
            </ResponsiveContainer>
          </div>
        </div>
      </div>

      {/* Machine Runtime Bar Chart */}
      <div className="bg-white p-6 rounded-lg shadow-md mb-8">
        <h2 className="text-xl font-semibold mb-4 text-gray-700">Average Runtime of Machines</h2>
        <div className="h-64">
          <ResponsiveContainer width="100%" height="100%">
            <BarChart data={machineRuntimeData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="machineId" />
              <YAxis label={{ value: 'Runtime (seconds)', angle: -90, position: 'insideLeft' }} />
              <Tooltip formatter={(value) => [`${value.toFixed(1)} seconds`, 'Avg Runtime']} />
              <Legend />
              <Bar dataKey="avgRuntime" fill="#82ca9d" name="Average Runtime (seconds)" />
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>

      {/* Dashboard Controls */}
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4 text-gray-700">Dashboard Controls</h2>
        <div className="flex flex-wrap gap-4">
          <button
            className="bg-black hover:bg-gray-800 text-white py-2 px-4 rounded-md"
            onClick={() => window.location.reload()}
          >
            Refresh Data
          </button>
          <button
            className="bg-black hover:bg-gray-800 text-white py-2 px-4 rounded-md"
            onClick={async () => {
              try {
                await fetch('/api/run-databricks-job', {
                  method: 'POST',
                  headers: { 'Content-Type': 'application/json' }
                });
                alert('Databricks job triggered successfully!');
              } catch (err) {
                alert('Failed to trigger Databricks job: ' + err.message);
              }
            }}
          >
            Run Prediction Job
          </button>
          <button
            className="bg-black hover:bg-gray-800 text-white py-2 px-4 rounded-md"
            onClick={async () => {
              try {
                const email = prompt('Enter email address for maintenance alert:');
                if (email) {
                  await fetch('/api/send-maintenance-email', {
                    method: 'POST',
                    headers: { 'Content-Type': 'application/json' },
                    body: JSON.stringify({ toEmail: email })
                  });
                  alert('Maintenance email sent successfully!');
                }
              } catch (err) {
                alert('Failed to send email: ' + err.message);
              }
            }}
          >
            Send Maintenance Alert
          </button>
        </div>
      </div>
    </div>
  );
}
